$(document).ready(function(){$.fn.dateinput=null,$("select.year").each(function(e,n){var o=$(n).find("option[selected]").val();$(n).children().remove(),$(n).append('<option value="">--</option>');for(var t=2030;1900<=t;t--){var a='<option value="'+t+'"'+(t==o?"selected":"")+">"+t+"</option>";$(n).append(a)}})});